INSERT INTO `testimonials` VALUES (1,'Jennifer Lee','From the initial consultation to closing day, the real estate team went above and beyond to ensure I found the perfect home. Their dedication and professionalism made the entire process seamless. Thank you!','avatars/5.jpg','Happy Home Seeker','published','2025-04-29 17:50:43','2025-04-29 17:50:43'),(2,'Robert Evans','I am impressed by the level of expertise and commitment demonstrated by this real estate team. Their insights into the market helped me make informed investment decisions, and I couldn\'t be happier with the results.','avatars/11.jpg','Property Investor','published','2025-04-29 17:50:43','2025-04-29 17:50:43'),(3,'Jessica White','Selling my home with the help of this real estate team was a breeze. They provided valuable advice, staged my property beautifully, and negotiated a great deal. I highly recommend their services to anyone looking to sell their home!','avatars/1.jpg','Delighted Home Seller','published','2025-04-29 17:50:43','2025-04-29 17:50:43'),(4,'Daniel Miller','Thanks to the expertise and guidance of this real estate team, I am now the proud owner of my dream home. They listened to my preferences, answered all my questions, and made the entire home buying process a positive experience.','avatars/11.jpg','Happy New Homeowner','published','2025-04-29 17:50:43','2025-04-29 17:50:43');
